const RadioButton = ({name='radio', type='radio'}) =>{

    const radio_style = {
        marginTop: '30px',
        alignItem: 'center',
        color: 'orange',
        cursor: 'pointer'
    }

    const [value, setValue] = useState(1);

    function changeValue(){
        setValue(event.target.value);
    }

    return(
        <div>
            <input name={name} type={type} value='1' style={radio_style} />
        </div>
    )
}

export default RadioButton;
